import { Component } from '@angular/core';

@Component({
  selector: 'app-root',
  templateUrl: './app.component.html',
  styleUrls: ['./app.component.css']
})
export class AppComponent {
  title = 'moogle-app';
}

<div class="col-xs-12" >
  <div class="row-xs-12">
    <h1 class="alert-success">Hello Moogle</h1>
    <button class="btn btn-danger">Hello Bootstrap</button>
  </div>
</div>
